import React from "react";
import styled from "styled-components";
import phoneShop from "../assets/projects/phone-shop.png";
import journey from "../assets/projects/journey.png";
import netflix from "../assets/projects/netflix.png";
import taskool from "../assets/projects/taskool.mp4";
import huddle from "../assets/projects/huddle.mp4";
import ham from "../assets/projects/theHam.mp4";
import createNote from "../assets/projects/createNote.mp4";
import findGiphy from "../assets/projects/findGiphy.mp4";
import knowladge from "../assets/projects/knowladge.mp4";
import musica from "../assets/projects/musica.mp4";
import numberPricing from "../assets/projects/numberPricing.mp4";
import avarageCalculator from "../assets/projects/avarageCalculator.mp4";
const Projects = () => {
  return (
    <ProjectsContainer id="projects">
      <h2>Some Example Projects</h2>
      <div>
        <div>
          <div>
            <img
              data-aos="fade-right"
              data-aos-duration="1200"
              src={phoneShop}
              alt=""
            />
          </div>
          <div>
            <img
              data-aos="fade-left"
              data-aos-duration="1200"
              src={journey}
              alt=""
            />
          </div>
          <div>
            <img
              data-aos="fade-right"
              data-aos-duration="1200"
              src={netflix}
              alt=""
            />
          </div>
          <div>
            <video
              data-aos="fade-left"
              data-aos-duration="1200"
              muted
              autoPlay
              loop
              src={musica}
            />
          </div>
          <div>
            <video
              data-aos="fade-right"
              data-aos-duration="1200"
              muted
              autoPlay
              loop
              src={ham}
            />
          </div>
          <div>
            <video
              data-aos="fade-left"
              data-aos-duration="1200"
              muted
              autoPlay
              loop
              src={huddle}
            />
          </div>
          <div>
            <video
              data-aos="fade-right"
              data-aos-duration="1200"
              muted
              autoPlay
              loop
              src={knowladge}
            />
          </div>
          <div>
            <video
              data-aos="fade-left"
              data-aos-duration="1200"
              muted
              autoPlay
              loop
              src={createNote}
            />
          </div>
          <div>
            <video
              data-aos="fade-right"
              data-aos-duration="1200"
              muted
              autoPlay
              loop
              src={findGiphy}
            />
          </div>
          <div>
            <video
              data-aos="fade-left"
              data-aos-duration="1200"
              muted
              autoPlay
              loop
              src={numberPricing}
            />
          </div>
          <div>
            <video
              data-aos="fade-right"
              data-aos-duration="1200"
              muted
              autoPlay
              loop
              src={avarageCalculator}
            />
          </div>
          <div>
            <video
              data-aos="fade-left"
              data-aos-duration="1200"
              muted
              autoPlay
              loop
              src={taskool}
            />
          </div>
        </div>
      </div>
    </ProjectsContainer>
  );
};

export default Projects;

const ProjectsContainer = styled.div`
div{
  display: flex;
  flex-direction: row;
}
  img,
  video {
    width: 450px;
    margin: 15px;
    /* height: 250px; */
    object-fit: contain;
    border-radius: 5px;
    :hover {
      opacity: 0.3;
      box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.123);
    }
  }
  h2 {
    margin: 60px auto;
  }
  div {
    margin-bottom: 100px;
  }
`;
